import React from 'react';
import logo from './logo.svg';
import { Button, ButtonGroup, Col, Container, Row } from 'react-bootstrap';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>
            <ButtonGroup>
              <Button variant="secondary">Dry</Button>
              <Button variant="secondary">Oily</Button>
            </ButtonGroup>
          </Col>
        </Row>
        <Row>
          <Col>
            Product
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
